  true,\n\t\"url\": null,\n\t\"notes\": \"_(Abstract):_  Geographic Information Systems
  (GIS) data rnintended for use in the Geospatial toolkit or with any GIS software.rnrn_(Purpose):_
  \ The Solar and Wind Energy Resource rnAssessment (SWERA) Geospatial Toolkit (GsT)
  is a map-based software rnapplication that can be used for decision making and policy
  analysis in rnaddition to planning for future energy projects. The SWERA application
  rnutilizes Geographical Information Systems (GIS) to develop common rnscenarios
  to evaluate potential locations for solar or wind energy rnplants. rnrn_(Supplemental
  Information):_   The zip file contains the available rngeospatial toolkit data and
  metadata. Each country's data package rndepends on the data provided by the SWERA
  partners.rnrn---------------------------------------------------------rnrnPlease
  visit [Geospatial Toolkit](http://en.openei.org/wiki/Geospatial_Toolkit) for additional
  information about the GsT and updates.\",\n\t\"license_title\": \"Other License
